import React from "react";
import {
  StyledLandingContainer,
  StyledMissionTitle,
  StyledStatement,
  StyledTitle,
  StyledDescription,
  StyledText,
  StyledTextContainer,
  StyledTextContainer2,
  StyledSocialContainer,
  StyledGridColumn,
  StyledGrid,
} from "./styles";
import {
  Container,
  Grid,
  GridColumn,
  Image,
  ImageGroup,
} from "semantic-ui-react";
import Date from "../../components/Time/Time";

import facebook from "../../res/images/facebook.png";
import instagram from "../../res/images/instagram.png";
import linkedin from "../../res/images/linkedin.png";
import twitter from "../../res/images/twitter.png";

// Landing page component
function Landing() {
  //Functions to track clicks
  return (
    <div>
      <Container
        text
        style={{
          marginLeft: "auto",
          marginRight: "auto",
          color: "white",
          width: "1004px",
          position: "relative",
          textAlign: "left",
        }}>
        <StyledMissionTitle>2020 Vision.</StyledMissionTitle>
      </Container>
      <Container
        text
        style={{
          marginLeft: "auto",
          marginRight: "auto",
          color: "white",
          width: "745px",
          position: "relative",
          textAlign: "left",
        }}>
        <StyledStatement>
          2020 marked the start of an incredibly difficult time period. It is
          easy to say that hindsight is 2020, but we do not live in the past and
          unfortunately can’t change the present — what we can do is learn,
          grow, and look toward the future with 20/20 vision.
        </StyledStatement>
      </Container>
    </div>
  );
}

export default Landing;
